import os
import signal
import subprocess
import webbrowser

import PySimpleGUI as sg

icon_file = b''
sg.theme('LightBlue')
sg.set_options(icon=icon_file)
start = 'https://'
branch = '-grey-go.t2.moego.pet'


def open_window():
    layout = [
        [sg.Text('Branch:', font=('Helvetica', 16)),
         sg.InputText(key='name', size=(25, 20), font=('Helvetica', 16), enable_events=True, default_text='bob'),
         sg.Text('Password:', font=('Helvetica', 16)),
         sg.InputText(password_char='*', size=(25, 20), font=('Helvetica', 16), key='password', default_text='')],

        [sg.Text('Connect K8S:', font=('Helvetica', 16)),
         sg.Button(image_data=toggle_btn_off, key='connect_main',
                   button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0,
                   metadata=False),
         sg.Text('PID:'),
         sg.Text(size=(40, 1), key='pid_main')],

        [sg.Text('moego-service-business:', font=('Helvetica', 16)),
         sg.Button(image_data=toggle_btn_off, key='connect_business',
                   button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0,
                   metadata=False),
         sg.Text('PID:'),
         sg.Text(size=(40, 1), key='pid_business')],

        [sg.Text('moego-service-customer:', font=('Helvetica', 16)),
         sg.Button(image_data=toggle_btn_off, key='connect_customer',
                   button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0,
                   metadata=False),
         sg.Text('PID:'),
         sg.Text(size=(40, 1), key='pid_customer')],

        [sg.Text('moego-service-grooming:', font=('Helvetica', 16)),
         sg.Button(image_data=toggle_btn_off, key='connect_grooming',
                   button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0,
                   metadata=False),
         sg.Text('PID:'),
         sg.Text(size=(40, 1), key='pid_grooming')],

        # [sg.Frame('Output', font='Helvetica 16', layout=[
        #     [sg.Output(size=(100, 10), font='Helvetica 10')]])],

        [sg.Text('Grey Gateway:', font=('Helvetica', 16)),
         sg.Button('https://grey.t2.moego.pet',
                   button_color=(sg.theme_background_color(), 'blue'),
                   font=('Helvetica', 16), key='link', border_width=0),
         sg.Text('Current Branch:', font=('Helvetica', 16)),
         sg.Button('https://go.t2.moego.pet',
                   button_color=(sg.theme_background_color(), 'blue'),
                   font=('Helvetica', 16), key='branch', border_width=0)],
    ]

    window = sg.Window('Local Test', layout)

    return window


def main():
    window = open_window()

    while True:
        event, values = window.read()

        def run_service(start_command, window_button, window_pid):
            window_button.update(disabled=True)
            # start_command = ['ls', '-al']
            print('start_command: ', start_command)
            print('start_command: ', ' '.join(start_command))
            try:
                ps = subprocess.Popen(start_command, stdout=subprocess.PIPE, encoding='utf-8',
                                      stderr=subprocess.STDOUT, close_fds=False, preexec_fn=os.setsid)
                # 恢复为默认状态
                signal.signal(signal.SIGPIPE, signal.SIG_DFL)
                out = ''
                # for line in ps.stdout.readline().rstrip():
                #     out += line
                    # if not line:
                    #     break
                # print(out)
                window_button.metadata = True
                window_button.update(image_data=toggle_btn_on)
                window_pid.update(ps.pid)
                window_button.update(disabled=False)
                return ps
            except Exception as e:
                sg.Print(f'execute got exception: {e}')
            # window_button.metadata = True
            # window_button.update(image_data=toggle_btn_on)
            # window_pid.update(ps.pid)
            # window_button.update(disabled=False)
            # return ps

        def stop_service(process_pid, window_button, window_pid):
            window_button.update(disabled=True)
            stop_command = 'echo ' + str.strip(values['password']) + ' | sudo -S kill -TERM -' + str(process_pid)
            print('stop_command: ', stop_command)
            os.system(stop_command)
            window_button.metadata = False
            window_button.update(image_data=toggle_btn_off)
            window_pid.update('')
            window_button.update(disabled=False)

        if event == sg.WINDOW_CLOSED:
            break
        elif event == 'name':
            name_branch = start + str.strip(values['name']) + branch
            window['branch'].update(text=name_branch)
        elif event == 'connect_main':
            if values['password'] == '':
                sg.popup_quick_message('Please Input Password', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            if values['name'] == '':
                sg.popup_quick_message('Please Input Branch Name', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            connect_window = window['connect_main']
            pid_window = window['pid_main']
            if connect_window.metadata is False:
                command = ['echo', str.strip(values['password']), '|', 'sudo', '-S', 'ktctl', 'connect', '-n',
                           'ns-testing', '--withLabel', '"sidecar.istio.io/inject=true"']
                ps_main = run_service(command, connect_window, pid_window)
            else:
                stop_service(ps_main.pid, connect_window, pid_window)
        elif event == 'connect_business':
            if values['password'] == '':
                sg.popup_quick_message('Please Input Password', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            if values['name'] == '':
                sg.popup_quick_message('Please Input Branch Name', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            connect_window = window['connect_business']
            pid_window = window['pid_business']
            if connect_window.metadata is False:
                command = ['ktctl', 'preview', 'moego-service-business-debug-' + str.strip(values['name']), '--expose',
                           '9203:9203', '-n', 'ns-testing', '--withLabel', '"sidecar.istio.io/inject=true"']
                ps_business = run_service(command, connect_window, pid_window)
            else:
                stop_service(ps_business.pid, connect_window, pid_window)
        elif event == 'connect_customer':
            if values['password'] == '':
                sg.popup_quick_message('Please Input Password', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            if values['name'] == '':
                sg.popup_quick_message('Please Input Branch Name', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            connect_window = window['connect_customer']
            pid_window = window['pid_customer']
            if connect_window.metadata is False:
                command = ['ktctl', 'preview', 'moego-service-customer-debug-' + str.strip(values['name']), '--expose',
                           '9203:9203', '-n', 'ns-testing', '--withLabel', '"sidecar.istio.io/inject=true"']
                ps_customer = run_service(command, connect_window, pid_window)
            else:
                stop_service(ps_customer.pid, connect_window, pid_window)
        elif event == 'connect_grooming':
            if values['password'] == '':
                sg.popup_quick_message('Please Input Password', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            if values['name'] == '':
                sg.popup_quick_message('Please Input Branch Name', font=('Helvetica', 16), background_color='red',
                                       text_color='white')
                continue
            connect_window = window['connect_grooming']
            pid_window = window['pid_grooming']
            if connect_window.metadata is False:
                command = ['ktctl', 'preview', 'moego-service-grooming-debug-' + str.strip(values['name']), '--expose',
                           '9203:9203', '-n', 'ns-testing', '--withLabel', '"sidecar.istio.io/inject=true"']
                ps_grooming = run_service(command, connect_window, pid_window)
            else:
                stop_service(ps_grooming.pid, connect_window, pid_window)
        elif event == 'link':
            webbrowser.open('https://grey.t2.moego.pet/')
        elif event == 'branch':
            if str.strip(values['name']) == "":
                webbrowser.open("https://go.t2.moego.pet")
            else:
                webbrowser.open(start + str.strip(values['name']) + branch)

    window.close()


if __name__ == '__main__':
    # The base64 strings for the button images
    toggle_btn_off = b''
    toggle_btn_on = b''

    main()
